                <NavLink to="/"><img src={IconLike} alt="" /></NavLink>
                <NavLink to="/ForMan"><img src={IconAccaunt} alt="" /></NavLink>
                <NavLink to="/"><img src={IconBascet} alt="" /></NavLink>
